css:
@-moz-document domain(responseecho-simonpercic.rhcloud.com ) {
	body {
		font-family: "Helvetica Neue", Helvetica, Arial, sans-serif;
    font-size: 14px;
    line-height: 1.42857143;
    color: #ababab;
    background-color: #313131;
	}
  
.panel-body {
    padding: 15px;
    color: #ababab;
    background-color: #313131;
}
pre.prettyprint {
    border: 1px solid #888;
    padding: 15px;
    color: #ababab;
    background-color: #6b7373;
}
.str {
    color: #000;
}
.panel-primary {
    border-color: #545454;
}
.panel-primary>.panel-heading {
    color: #fff;
    background-color: #495e6f;
    border-color: #8e8e8e;
}
.nav-pills>li.active>a,
.nav-pills>li.active>a:focus,
.nav-pills>li.active>a:hover {
    color: #fff;
    background-color: #3c5973;
}
.pun,
.opn,
.clo {
    color: #092c80;
}
.lit {
    color: #001798;
}
.table>tbody>tr>td,
.table>tbody>tr>th,
.table>tfoot>tr>td,
.table>tfoot>tr>th,
.table>thead>tr>td,
.table>thead>tr>th {
    padding: 8px;
    line-height: 1.42857143;
    vertical-align: top;
    border-top: 0px solid #ddd;
}
}
